style.css:
body {
    background-color: #4B0082; /* фиолетовый фон */
    color: #FFFFFF; /* белый шрифт */
    font-family: Arial, sans-serif; /* шрифт */
    margin: 0;
    padding: 0;
}

header {
    background-color: #000000; /* чёрный фон */
    padding: 20px;
}

nav ul {
    list-style-type: none;
    margin: 0;
    padding: 0;
}

nav ul li {
    display: inline;
}

nav ul li a {
    color: #FFFFFF; /* белый цвет ссылок */
    text-decoration: none;
    padding: 10px 20px;
}

nav ul li a:hover {
    background-color: #663399; /* изменение цвета при наведении */
}

main {
    padding: 20px;
}

footer {
    background-color: #000000; /* чёрный фон */
    color: #FFFFFF; /* белый шрифт */
    text-align: center;
    padding: 10px;
}
